/* eslint-disable */
import { createApp } from 'vue'
import App from './App.vue'
import router from "@/router";
import vueHelmet from "vue-helmet/src/VueHelmet";
import * as VueGoogleMaps from "vue3-google-map";
import IdleVue from 'idle-vue'

createApp(App)
    .use(VueGoogleMaps,{ load: {key: "AIzaSyAGPbYfcYqdbSBeXdIpH5iWrznfU886Qk8"}})
    .use(router)
    .use(vueHelmet)
    .use(IdleVue)
    .mount('#app')



    .use(IdleVue, createApp, {
  idleTime: 10000,
  startEventName: "load",
  resetEvents: ["click", "mousemove", "keydown", "touchstart"],
  idleTimeoutCallback: () => {
    app.$router.push("/");
  },
});
